          title: "tets",
          done: false
        },
        {
          id: 1,
          title: "test2",
          done: true
        }
      ]
    }
  }
  render(){
    return (
      <div className = "App">
        <h2> TodoList </h2>
        <TodoList
          todos={this.state.todos}
        />
      </div>
    );
  }
}

